import React from 'react';
import { FiLogIn } from 'react-icons/fi'
import './styles.css';
import logo from '../../assets/logo.svg';

const Home = () => {
    return (
        <div id="page-home">
            <div className= "content">
                <header>
                    <img src={logo} alt="Ecoleta" />
                </header>

                <main>
                    <h1></h1>
                    <p></p>
                
                    <a href="/cadastro">
                        
                        <strong></strong>
                    </a>
                </main>
            </div>
        </div>
    )
}

export default Home;
